import React from "react";

const WorkoutWeekCard = ({
  week,
  weekIndex,
  weeks,
  setWeeks,
  selectedRunner,
  handleWorkoutRegistration, // Recebe a função como prop
}) => {
  const handleChange = (e, day) => {
    const updatedWeeks = [...weeks];
    updatedWeeks[weekIndex].workout[day] = e.target.value;
    setWeeks(updatedWeeks);
  };

  const handleLongRunChange = (e, field) => {
    const updatedWeeks = [...weeks];
    updatedWeeks[weekIndex][field] = e.target.value;
    setWeeks(updatedWeeks);
  };

  const handleUpdateWorkout = (week) => {
    if (selectedRunner && week) {
      const { longRunDistance, longRunDurationMinutes } = week;

      const url = `http://localhost:8080/workout/${selectedRunner.email}/${week.week}?distance=${longRunDistance}&duration=${longRunDurationMinutes}`;

      fetch(url, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
      })
        .then((response) => response.json())
        .then((data) => {
          if (data) {
            alert("Treino atualizado com sucesso!");

            setWeeks((prevWeeks) =>
              prevWeeks.map((w) =>
                w.week === week.week
                  ? {
                    ...w,
                    longRunDistance: week.longRunDistance,
                    longRunDurationMinutes: week.longRunDurationMinutes,
                    longRunPace: data.longRunPace,
                  }
                  : w
              )
            );
          } else {
            throw new Error("Erro ao atualizar o treino.");
          }
        })
        .catch(() => alert("Erro ao atualizar o treino."));
    }
  };

  return (
    <div className="workout-week-card">
      <div className="week-header">
        <strong>Semana {week.week}</strong>
      </div>
      <div className="week-status">
        {week.hasWorkout ? (
          <p className="status-registered">Treino cadastrado</p>
        ) : (
          <p className="status-not-registered">Nenhum treino cadastrado</p>
        )}
      </div>
      <div className="week-workout">
        {Object.entries(week.workout).map(([day, value]) => {
          if (["monday", "tuesday", "wednesday", "thursday", "friday", "saturday", "sunday"].includes(day)) {
            return (
              <div key={day} className="workout-field">
                <label>{day.charAt(0).toUpperCase() + day.slice(1)}:</label>
                <input
                  type="text"
                  value={value}
                  onChange={(e) => handleChange(e, day)}
                  disabled={week.hasWorkout}
                  className="workout-input"
                />
              </div>
            );
          }
          return null;
        })}

        <div className="workout-field">
          <label>Distância do Long Run (km):</label>
          <input
            type="number"
            value={week.longRunDistance}
            onChange={(e) => handleLongRunChange(e, "longRunDistance")}
            className="workout-input"
          />
        </div>

        <div className="workout-field">
          <label>Duração do Long Run (minutos):</label>
          <input
            type="time"
            step="1"
            value={week.longRunDurationMinutes || ""}
            onChange={(e) => handleLongRunChange(e, "longRunDurationMinutes")}
            className="workout-input"
          />
        </div>

        <div className="workout-field">
          <label>Pace Longão:</label>
          <input
            type="text"
            value={week.longRunPace || ""}
            readOnly
            className="workout-input"
          />
        </div>

        {week.hasWorkout ? (
          <button
            onClick={handleUpdateWorkout}
            className="button workout-update-button"
          >
            Atualizar Treino
          </button>
        ) : (
          <button
            onClick={() => handleWorkoutRegistration(week)} // Usa a função passada como prop
            className="button workout-register-button"
          >
            Registrar Treino
          </button>
        )}
      </div>
    </div>
  );
};

export default WorkoutWeekCard;
